import React from "react";

const SlotM =() => {
    const SlotM = (props) =>{
        let x = props.x;
        let y = props.y;
        let z = props.z;
    
    if (x === y && y === z) {
        return <>
        <h1>{x},{y},{z}</h1>
        <h1> Matching </h1>
        </>
    }
    
         else {
            return <>
            <h1>{x},{y},{z}</h1>
            <h1> Not Matching </h1>
        </>
        };
    
    };
};

export default SlotM;
